import React,{useState} from "react";
import './Projectline.css';
import star from "./ster-paars.svg"



function Projectline({title,  datum, hour}){
    const [formRule, setFormRule]= useState(null)
    function removeData(){
        localStorage.clear();
        const formName = localStorage.getItem("FormProjectnaam")
        setFormRule(formName);
    }


    return(
<>
        {Object.keys(formRule).length > 1 &&
                <div className="project-line">
                    <div className="project-title">
                        <img className='star' src={star} alt="sterlogo"/>
                        <h2>{title}</h2>

                        <h3> {datum}</h3>
                        <p> Totaal aan design nodig: {hour}</p>
                    </div>

                    <div className="buttons-project">
                        <button
                            onClick={removeData}> Remove
                        </button>
                    </div>

                </div>
        }
</>
    )
}

export default Projectline
